import { withRouter } from "react-router-dom";
import {CardElement} from '@stripe/react-stripe-js'

const Payment = () => {
    return (
        <>
            <h1>Card</h1>

            <form id='payment-form'>
                <label htmlFor="card-element">Card</label>
                <Element>
                    <CardElement />
                </Element>
                <button>Pay</button>
            </form>
        </>
    )
}
 export default Payment;
